cy.get('.color').then(function (colors) {
  var currentColors;
  var previousColors;
  previousColors = Array.from(colors).map(function (color) {
    return Cypress.$(color).css('background-color');
  });
  for (var i = 0; i < 5; i += 1) {
    cy.reload();
    cy.get('.color').then(function (colors) {
      currentColors = Array.from(colors).map(function (color) {
        return Cypress.$(color).css('background-color');
      });
      expect(currentColors).not.to.deep.equal(previousColors);
      previousColors = currentColors;
    });
  }
});

